// ==UserScript==
// @name         Abema open channel in new tab
// @description  abemaのチャンネルを別タブで開くスクリプト
// @version      1.0.1
// @author       Yos_sy
// @match        https://abema.tv/*
// @namespace    http://tampermonkey.net/
// @icon         data:image/png;base64,
// @license      MIT
// @run-at       document-start
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/498739/abema-open-channel-in-new-tab.user.js
// @updateURL https://update.greasyfork.org/scripts/498739/abema-open-channel-in-new-tab.meta.js
// ==/UserScript==

(function () {
  "use strict";

  const LINK_SELECTORS = [
    '.com-home-ChannelCardLink a[href^="/now-on-air/"]',
    '.com-tv-LinearChannelListItem a[href^="/now-on-air/"]',
  ];

  // リンクを修正して新しいタブで開く
  function modifyLink(link) {
    if (link.dataset.modified) return;

    const fullUrl = new URL(link.getAttribute("href"), "https://abema.tv").href;

    link.addEventListener("click", openInNewTabAndClose);
    link.setAttribute("target", "_blank");
    link.setAttribute("rel", "noopener noreferrer");
    link.href = fullUrl;
    link.dataset.modified = "true";
  }

  // 新しいタブでリンクを開き、元のタブを閉じるイベント
  function openInNewTabAndClose(event) {
    event.preventDefault();
    event.stopPropagation();
    const fullUrl = new URL(this.getAttribute("href"), "https://abema.tv").href;
    window.open(fullUrl, "_blank", "noopener,noreferrer");
    setTimeout(() => {
      window.close();
    }, 100);
  }

  // リンクを修正
  function modifyLinks() {
    LINK_SELECTORS.forEach((selector) => {
      document.querySelectorAll(selector).forEach(modifyLink);
    });
  }

  // DOMの変更を監視
  function initObserver() {
    const observer = new MutationObserver((mutations) => {
      mutations.forEach((mutation) => {
        if (mutation.type === "childList") {
          mutation.addedNodes.forEach((node) => {
            if (node.nodeType === Node.ELEMENT_NODE) {
              LINK_SELECTORS.forEach((selector) => {
                if (node.matches(selector)) {
                  modifyLink(node);
                } else {
                  node.querySelectorAll(selector).forEach(modifyLink);
                }
              });
            }
          });
        }
      });
    });

    observer.observe(document.body, {
      childList: true,
      subtree: true,
    });
  }

  // 初期化
  function init() {
    modifyLinks();
    initObserver();
  }

  // DOMの読み込みが完了したら初期化
  if (document.readyState === "loading") {
    document.addEventListener("DOMContentLoaded", init);
  } else {
    init();
  }
})();
